INSERT INTO `faqs` VALUES (1,'What do we offer?','what-do-we-offer','<p>With an innovative idea to provide you with a faster and better service. Glass Pipe is here for swift service.</p>\r\n\r\n<p>a Latin word - meaning swift, quick.</p>\r\n\r\n<p>Glass Pipeis an e-commerce platform where you can get what you need in the quickest way possible.</p>',1,'What do we offer?','What do we offer?','What do we offer?','2023-07-16 11:50:08','2024-05-20 09:27:24'),(3,'What payment methods do you accept?','what-payment-methods-do-you-accept','<p>We accept payments through various secure methods, including credit/debit cards, PayPal, and other popular payment gateways.</p>',1,'What payment methods do you accept?','What payment methods do you accept?','What payment methods do you accept?','2023-08-06 10:21:32','2024-05-20 09:27:12'),(4,'How long will it take to receive my order?','how-long-will-it-take-to-receive-my-order','<p>Shipping times vary depending on your location and the shipping method chosen during checkout. Typically, orders are processed and shipped within [insert timeframe], and delivery times range from [insert timeframe] for domestic orders and [insert timeframe] for international orders.</p>',1,'How long will it take to receive my order?','How long will it take to receive my order?','How long will it take to receive my order?','2024-05-09 12:10:04','2024-05-20 09:26:58'),(5,'Do you offer international shipping?','do-you-offer-international-shipping','<p>Yes, we offer international shipping to select countries. Shipping costs and delivery times may vary depending on the destination. Please refer to our shipping policies or contact us for more information on international shipping options.</p>',1,'Do you offer international shipping?','Do you offer international shipping?','Do you offer international shipping?','2024-05-09 12:10:27','2024-05-20 09:26:46'),(6,'How can I track my order?','how-can-i-track-my-order','<p>Once your order has been shipped, you will receive a shipping confirmation email with a tracking number. You can use this tracking number to monitor the status of your shipment on our website or through the designated courier&#39;s tracking portal.</p>',1,'How can I track my order?','How can I track my order?','How can I track my order?','2024-05-09 12:11:18','2024-05-20 09:26:22');
/*!40000 ALTER TABLE `faqs` ENABLE KEYS */;
