INSERT INTO `menus` VALUES (1,'Animal Designs','bennevis-icecream','App\\Models\\Category',23,5,'https://glasspipenepal.com/storage/photos/logo-pot-nepal.png',NULL,NULL,NULL,1,'Glass Pipe Nepal |  Best Glass Pipes & Accessories at Glass Pipe Nepal','Glass pipes , Smoking accessories , Nepali glassware , Handcrafted pipes , Unique smoking products , Online ,smoke shop , Premium smoking gear , Tobacco pipes , Himalayan glass pipes , Nepali craftsmanship','Explore a wide selection of intricately crafted glass pipes and accessories at Glass Pipe Nepal. Discover unique designs and high-quality materials perfect for any smoking enthusiast. Shop now for premium smoking experiences','https://glasspipenepal.com/storage/photos/logo-pot-nepal.png',9,12,NULL,'1','2','2024-05-20 05:38:23','2023-07-11 17:12:41','2024-05-20 05:38:23'),(2,'About Us','about-us','App\\Models\\Page',NULL,1,'https://mystore.com.np/storage/photos/n07.jpg','https://mystore.com.np/storage/photos/mystore.png','<p><big>Welcome to My Store, your ultimate destination for quality products and a seamless shopping experience. As a newly launched ecommerce platform, we pride ourselves on offering a diverse range of items across various categories, including fashion, electronics, home &amp; kitchen, health &amp; beauty, and toys &amp; games. Each product is carefully selected to meet our high standards of quality, ensuring that you receive only the best. Whether you&#39;re looking to update your wardrobe, upgrade your tech gadgets, or find the perfect gift, My Store has something for everyone.</big></p>\r\n\r\n<p><big>At My Store, customer satisfaction is at the heart of everything we do. We believe in providing exceptional service from the moment you visit our site to the delivery of your purchase. Our user-friendly website makes browsing and purchasing a breeze, and our dedicated customer service team is always ready to assist with any queries or concerns. We also prioritize your security, utilizing the latest encryption technology to safeguard your personal and payment information, giving you peace of mind while you shop.</big></p>\r\n\r\n<p><big>We invite you to join our growing community of happy customers who trust My Store for their shopping needs. Stay connected with us through our social media channels and subscribe to our newsletter to stay informed about the latest arrivals, exclusive deals, and special promotions. Thank you for choosing My Store &ndash; we are excited to serve you and make your online shopping experience enjoyable and rewarding.</big></p>',NULL,1,'My Store - Best Online Ecommerce in Nepal | Electronics & Gadgets','Best Online Store','Welcome to My Store, where your shopping experience is our top priority. As a new ecommerce platform, we are committed to offering a diverse range of high-quality products to meet all your needs. Whether youâ€™re looking for the latest in fashion, cutting-edge electronics, or everyday essentials, we have something for everyone.','https://mystore.com.np/storage/photos/mystore.png',13,14,NULL,'3','3',NULL,'2023-07-14 16:42:33','2024-06-21 12:18:07'),(3,'Privacy Policy','privacy-policy','App\\Models\\Page',NULL,6,NULL,NULL,'<h2><strong>Who we are</strong></h2>\r\n\r\n<p>Our website address is: https://glasspipenepal.com</p>\r\n\r\n<h2><strong>Comments</strong></h2>\r\n\r\n<p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&rsquo;s IP address and browser user agent string to help spam detection.</p>\r\n\r\n<h2><strong>Media</strong></h2>\r\n\r\n<p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p>\r\n\r\n<h2><strong>Cookies</strong></h2>\r\n\r\n<p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p>\r\n\r\n<p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p>\r\n\r\n<p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &ldquo;Remember Me&rdquo;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p>\r\n\r\n<p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p>\r\n\r\n<h2><strong>Embedded content from other websites</strong></h2>\r\n\r\n<p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p>\r\n\r\n<p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p>\r\n\r\n<h2><strong>Who we share your data with</strong></h2>\r\n\r\n<p>If you request a password reset, your IP address will be included in the reset email.</p>\r\n\r\n<h2><strong>How long we retain your data</strong></h2>\r\n\r\n<p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p>\r\n\r\n<p>For users that register on our website (if any), we also store the pe