e number, fax number, payment details, payment card details, or bank account details.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;For Buyers:</strong></p>\r\n\r\n<p>- Identity data: such as your name, gender, profile picture, and date of birth.</p>\r\n\r\n<p>- Contact data: such as billing address, delivery address/location, email address, and phone numbers.</p>\r\n\r\n<p>- Biometric data: such as voice files and face recognition when you use our voice search function.</p>\r\n\r\n<p>- Transaction records/data: such as details about orders and payments, user clicks, and other product and service-related details.</p>\r\n\r\n<p>- Technical data: such as IP address, login data, browser type and version, time zone setting, device information, browser plug-in types and versions, operating system and platform, device identifier, IMEI, MAC address, and cookies (where applicable).</p>\r\n\r\n<p>- Profile data: such as username and password, account settings, order history, user research, interests, preferences, feedback, and survey responses.</p>\r\n\r\n<p>- Usage data: such as information on how you use the Site, including time spent on the Site, items and data searched for, access times and dates, and websites visited before the Site.</p>\r\n\r\n<p>- Location data: such as when you share your location in the form of photographs or videos.</p>\r\n\r\n<p>- Marketing and communications data: such as preferences in receiving marketing from us and our third parties, communication preferences, and chat, email, or call history.</p>\r\n\r\n<p>- Additional information: such as copies of government-issued identification for identity verification.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;For Sellers:</strong></p>\r\n\r\n<p>- Identity and contact data: such as name, date of birth, company name, address, email address, phone number, and other business-related information (e.g., company registration number, business license, tax information, shareholder and director information).</p>\r\n\r\n<p>- Transaction data: such as details about orders and payments, and other product and service-related details.</p>\r\n\r\n<p>- Technical data: such as IP address, login data, browser type and version, time zone setting, device identifier, IMEI, MAC address, and cookies (where applicable).</p>\r\n\r\n<p>- Profile data: such as username and password, orders, interests, preferences, feedback, and survey responses.</p>\r\n\r\n<p>- Usage data: such as information on how you use the Site, including time spent on the Site, items and data searched for, access times and dates, and websites visited before the Site.</p>\r\n\r\n<p>- Location data: such as when you share your location in the form of photographs or videos.</p>\r\n\r\n<p>- Marketing and communications data: such as preferences in receiving marketing from us and our third parties, and communication preferences.</p>\r\n\r\n<p>- Additional information: such as copies of government-issued identification for authentication.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;Use of Information</strong></p>\r\n\r\n<p><strong>&nbsp;For Buyers:</strong></p>\r\n\r\n<p>- Processing orders: Process orders you submit through the Site and deliver the products you have purchased. We may pass your personal information to third parties (e.g., logistics partners) for delivery.</p>\r\n\r\n<p>- Customer support: Provide support for your orders and verify and carry out payment transactions. Payment information may be transferred to third parties such as payment service providers.</p>\r\n\r\n<p>- Services: Facilitate your use of the services or access to the Site, administer your account, and display your name, username, or profile on the Site (including reviews).</p>\r\n\r\n<p>- Marketing and advertising: Provide you with information you may find useful and send marketing or promotional information (with your consent). Conduct marketing and advertising.</p>\r\n\r\n<p>- Legal and operational purposes: Verify your identity for fraud detection, ensure information accuracy, process complaints, produce statistics and research, store and back up your data, prevent or investigate violations of our policies, comply with legal requirements, and prevent threats to life, health, or safety.</p>\r\n\r\n<p>- Analytics and research: Understand your user experience, improve the Site layout and content, identify visitors, conduct surveys, derive further attributes, conduct data analysis and research, and develop our products and services.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;For Sellers:</strong></p>\r\n\r\n<p>- Services: Facilitate your use of the Site, respond to queries, verify documentation, administer your account, display your name or profile, verify and carry out financial transactions, assess loan applications, provide logistics services, and facilitate product returns.</p>\r\n\r\n<p>- Marketing and advertising: Send marketing or promotional materials (with your consent) and conduct marketing and advertising.</p>\r\n\r\n<p>- Legal and operational purposes: Produce statistics and research, store and back up your data, prevent or investigate policy violations, comply with legal requirements, process complaints and feedback, verify information accuracy, and facilitate the takedown of prohibited items.</p>\r\n\r\n<p>- Analytics and research: Audit data downloads, understand user experience, improve the Site layout and content, conduct surveys, derive further attributes, conduct data analysis and research, and develop our products and services.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Other Uses of Your Personal Information</strong></p>\r\n\r\n<p>We may use your personal information for opinion and market research. Your details are anonymous and will only be used for statistical purposes. You can opt out at any time. We may also send you other information about us, the Site, our other websites, our products, sales promotions, and our newsletters. If you prefer not to receive any additional information, please click the &#39;unsubscribe&#39; link in any email we send to you. We will cease sending information within 7 working days.</p>\r\n\r\n<p>We may further anonymize data about users and use it for various purposes, including ascertaining general user locations and usage statistics, and providing anonymized data to third parties. However, this data will not identify you personally.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Competitions</strong></p>\r\n\r\n<p>For any competition, we use data to notify winners and advertise our offers. More details can be found in the participation terms for the respective competition.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Third Parties and Links</strong></p>\r\n\r\n<p>We may pass your details to other companies in our group or our agents and subcontractors to assist with any uses of your data set out in this Privacy Policy. We may also exchange information with third parties for fraud protection and credit risk reduction.</p>\r\n\r\n<p>We may share your personal data with third parties and affiliates for the purposes mentioned above. These third parties and affiliates may be located inside or outside your jurisdiction and include service providers in areas such as payment services, logistics, marketing, data analytics, market research, social media, customer service, IT, and website hosting. We may transfer our databases containing your personal information if we sell our business or part of it, in compliance with applicable data protection laws.</p>\r\n\r\n<p>The Site may contain third-party advertising and links to other sites. We are not responsible for the privacy practices or content of these third parties or other sites. You are advised to check the privacy policies of those websites.</p>\r\n\r\n<p>In disclosing your personal data to third parties, we ensure that they keep your data secure and retain it only as long as necessary. We may transfer your personal data outside of Nepal in compliance with applicable laws and this Privacy Policy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cookies</strong></p>\r\n\r\n<p>We or our authorized service providers may use cookies, web beacons, and other similar technologies in connection with your use of the Site. Cookies are small text files placed in your browser or device memory when you visit a website. Web beacons are small graphic images included on the Site. They allow us to recognize your device or browser and count users who have viewed specific pages. Cookies help us remember your preferences and save you time. However, some cookies are required to enable core functionality. Your browser can be set to not accept cookies, but this may restrict your use of the Site.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Security</strong></p>\r\n\r\n<p>We have implemented appropriate technical and security</p>\r\n\r\n<p>measures to prevent unauthorized or unlawful access, accidental loss, destruction, or damage to your information. When we collect data through the Site, we collect your personal details on a secure server. We use firewalls and encryption for information security. While we cannot guarantee absolute security, we take necessary precautions to protect your data.</p>\r\n\r\n<p>You are responsible for protecting your account password and keeping it confidential. Avoid using the same password for multiple accounts. If you suspect your password has been compromised, change it immediately.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Your Rights</strong></p>\r\n\r\n<p>If you are concerned about your data, you have the right to request access to your personal data held by us. You may request us to correct any inaccuracies in your data, free of charge. At any stage, you have the right to ask us to stop using your personal data for direct marketing purposes.</p>',NULL,1,'Privacy Policy',NULL,NULL,NULL,53,54,NULL,'3','3',NULL,'2024-06-02 05:54:00','2024-06-21 12:18:07'),(28,'Warranty Policy','warranty-policy','App\\Models\\Page',NULL,8,NULL,NULL,'<p>My Store Nepal values your satisfaction with our products. This Warranty Policy outlines the terms and conditions for the warranty coverage provided on our products.</p>\r\n\r\n<p><strong>2. Warranty Coverage</strong></p>\r\n\r\n<p><strong>Duration</strong><br />\r\nThe warranty period for each product is specified in the product description on our website. If not specified, the default warranty period is [insert standard warranty period, e.g., 1 year] from the date of purchase.</p>\r\n\r\n<p><strong>Scope</strong><br />\r\nThis warranty covers defects in materials and workmanship under normal use. It does not cover damage caused by:</p>\r\n\r\n<ul>\r\n	<li>Misuse, abuse, or neglect</li>\r\n	<li>Unauthorized modifications or repairs</li>\r\n	<li>Accidents or natural disasters</li>\r\n	<li>Normal wear and tear</li>\r\n</ul>\r\n\r\n<p><strong>3. Warranty Claims</strong></p>\r\n\r\n<p><strong>Evaluation</strong><br />\r\nUpon receiving your claim, we will evaluate the issue and determine if it is covered under warranty. We may request additional information or ask you to send the product to us for inspection.</p>\r\n\r\n<p><strong>4. Remedies</strong></p>\r\n\r\n<p><strong>Repair or Replacement</strong><br />\r\nIf your product is found to be defective and covered under warranty, we will, at our discretion, repair or replace the product at no additional cost to you.</p>\r\n\r\n<p><strong>Refunds</strong><br />\r\nIn cases where repair or replacement is not feasible, we may offer a refund of the purchase price.</p>\r\n\r\n<p><strong>5. Shipping Costs</strong></p>\r\n\r\n<p><strong>Initial Shipping</strong><br />\r\nThe customer is responsible for shipping costs to return the product for warranty evaluation.</p>\r\n\r\n<p><strong>Return Shipping</strong><br />\r\nIf the product is deemed defective and covered under warranty, we will cover the shipping costs to return the repaired or replacement product to you.</p>\r\n\r\n<p><strong>6. Limitations and Exclusions</strong></p>\r\n\r\n<p><strong>No Other Warranties</strong><br />\r\nExcept as expressly provided in this policy, My Store Nepal makes no other warranties, express or implied, including any implied warranties of merchantability or fitness for a particular purpose.</p>\r\n\r\n<p><strong>Limitation of Liability</strong><br />\r\nOur liability is limited to the repair, replacement, or refund of the defective product. We are not liable for any indirect, incidental, or consequential damages arising from the use of our products.</p>',NULL,1,NULL,NULL,NULL,NULL,55,56,NULL,'3','3',NULL,'2024-06-02 06:17:04','2024-06-21 12:18:42');
